        <div style={{ display: 'flex', flexDirection: 'column', gap: '16px' }}>
          <Space size="small">
            <Box>Small</Box>
            <Box>8px</Box>
          </Space>
          <Space size="middle">
            <Box>Middle</Box>
            <Box>16px</Box>
          </Space>
          <Space size="large">
            <Box>Large</Box>
            <Box>24px</Box>
          </Space>
        </div>
